import react from 'react';
import './Home.css';


//arrow func for creating func comp home that returns an html
const Home=()=>{
    return(
        <div>
            <h1>BMI CALCULATOR</h1>
            <div id="form">
                <p>Enter your height in centimeters</p>
                <input type="number" step="any" placeholder='Height in Cms' id="height"></input>
                <p>Enter your weight in kilograms</p>
                <input type="number" step="any" placeholder='Weight in Kgs' id="weight"></input>
                <button>SUBMIT</button>
            </div>
        </div>
    )
}

export default Home
